import { Fragment } from "react";

import styles  from "../../CSS/NavbarComponents/Navbar.module.css";

const Navbar = () => {
    return (
        <Fragment>
            <div className={styles.main-navbar}>
                <form>
                    <input typr="text" />
                    <button type="submit"></button>
                </form>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Shop</li>
                    <li>CLORE</li>
                    <li>Pages</li>
                    <li>Blog</li>
                    <li>Contact</li>
                </ul>
            </div>


        </Fragment>
    );
}

export default Navbar;
